const Images = [
    {
        id:1,
        img:require("../../assets/img1.jpeg"),
    },
    {
        id:2,
        img:require("../../assets/img2.jpeg"),
    },
    {
        id:3,
        img:require("../../assets/img3.jpeg"),
    },
    {
        id:4,
        img:require("../../assets/icon.png"),
    },
    {
        id:5,
        img:require("../../assets/favicon.png"),
    },
    {
        id:6,
        img:require("../../assets/splash.png"),
    },
    {
        id:7,
        img:require("../../assets/img1.jpeg"),
    },
];
export default Images;
